window.bookSummaryJSON = "<p>Prince Dutiful has been rescued from his Piebald kidnappers and the court has resumed its normal rhythms. There FitzChivalry Farseer, gutted by the loss of his wolf bondmate, must take up residence at Buckkeep as a journeyman assassin. </p> <p>Posing as a bodyguard, Fitz becomes the eyes and ears behind the walls, guiding a kingdom straying closer to civil strife each day. Amid a multitude of problems, Fitz must ensure that no one betrays the Prince’s secret - one that could topple the throne: that he, like Fitz, possesses the dread \"beast magic.\" Only Fitz’s friendship with the Fool brings him solace. But even that is shattered when devastating revelations from the Fool’s past are exposed. Bereft of support and adrift in intrigue, Fitz finds that his biggest challenge may be simply to survive.</p> <p></p>"; 
